                instrukcjaViewModel.ContentOfInstruction = InstrukcjaVM.ContentOfInstruction;
                instrukcjaViewModel.InstructionOrOther = InstrukcjaVM.InstructionOrOther;
                sURLToFile = InstrukcjaVM.URLToFile;
